const changeNamespaceList=async event=>{const el=event.currentTarget,categoryList=el.value.replace(/ /g,"").toLowerCase();if(!categoryList)return void toast("warning","This feature is not currently available","Sorry");const review_id=el.id.replace("type_namespace","");document.getElementById(`type_category${review_id}`).setAttribute("list",categoryList)},changeCategoryList=async event=>{const el=event.currentTarget,classifierList=el.value.replace(/ /g,"").toLowerCase();if(!classifierList)return void toast("warning","This feature is not currently available","Sorry");const review_id=el.id.replace("type_category","");document.getElementById(`type_classifier${review_id}`).setAttribute("list",classifierList)};document.addEventListener("DOMContentLoaded",(async()=>{for await(const el of document.querySelectorAll('[name="type_namespace"]')){el.addEventListener("change",changeNamespaceList,!1);const categoryList=el.value.replace(/ /g,"").toLowerCase();if(categoryList){const review_id=el.id.replace("type_namespace","");document.getElementById(`type_category${review_id}`).setAttribute("list",categoryList)}}for await(const el of document.querySelectorAll('[name="type_category"]')){el.addEventListener("change",changeCategoryList,!1);const classifierList=el.value.replace(/ /g,"").toLowerCase();if(classifierList){const review_id=el.id.replace("type_category","");document.getElementById(`type_classifier${review_id}`).setAttribute("list",classifierList)}}}),!1);